import React from "react";

const namespace = 'taskdata';

const TaskData = ({
    data: {
        title,
        priority,
        status,
        description
    }
  }) => {

  return (
    <div className={`${namespace}__card`}>
      <div>Prioridad: {priority}</div>
      <div>Estado: {status}</div>
      <div>Titulo: {title}</div>
      <div>Descripcion<br />{description}</div>
    </div>
  );
};

export default TaskData;
